def interpolator_generator(x1, y1, x2, y2, x3, y3, x, y):
	#~ D=x2*y3+x1*y2+x3*y1-x2*y1-x3*y2-y3*x1
	#~ H1=(x2*y3-x3*y2+(y2-y3)*x+(x3-x2)*y)/D
	#~ H2=(x3*y1-x1*y3+(y3-y1)*x+(x1-x3)*y)/D
	#~ H3=(x1*y2-x2*y1+(y1-y2)*x+(x2-x1)*y)/D	
    dist1=math.sqrt((x-x1)*(x-x1)+(y-y1)*(y-y1))
    dist2=math.sqrt((x-x2)*(x-x2)+(y-y2)*(y-y2))
    dist3=math.sqrt((x-x3)*(x-x3)+(y-y3)*(y-y3))
    def interpolate(u1, u2, u3):
        if dist1==0:
            return u1
        elif dist2==0:
            return u2
        elif dist3==0:
            return u3
        else:
            U=(u1/dist1+u2/dist2+u3/dist3)/(1/dist1+1/dist2+1/dist3)
		#~ U=H1*u1+H2*u2+H3*u3
            return U
    return interpolate
